import React from "react";
import styled from "styled-components";

export const Note = (props) => {
  return (
    <StyledDiv>
      <span className={props.style}>{props.num}</span>
    </StyledDiv>
  );
};

Note.defaultProps = {
  num: 0,
  style: "empty",
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  border: 1px solid lightgray;
  color: lightgray;

  .closed {
    text-decoration: line-through;
  }
  .empty {
    visibility: hidden;
  }
  .open {
    font-weight: normal;
  }
  .accent {
    color: #61dbfb;
    font-weight: bold;
  }
`;

// just make these css classes lol
const Closed = styled.span`
  text-decoration: line-through;
`;

const Empty = styled.span`
  visibility: hidden;
`;

const Open = styled.span`
  font-weight: normal;
`;

const Highlight = styled.span`
  font-weight: bold;
`;
